# Definición del esquema y las tablas

DROP SCHEMA IF EXISTS superheroes;
CREATE SCHEMA superheroes;
USE superheroes;

CREATE TABLE persona_real (
  id_persona INT,
  nombre VARCHAR(100),
  apellido VARCHAR(100),
  ciudad VARCHAR(100),
  PRIMARY KEY (id_persona)
);

CREATE TABLE superheroe (
  id_sup INT,
  nombre VARCHAR(100),
  avatar LONGBLOB,
  id_persona INT NOT NULL,
  PRIMARY KEY (id_sup),
  FOREIGN KEY (id_persona) REFERENCES persona_real (id_persona)
    ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE TABLE villano (
  id_villano INT,
  nombre VARCHAR(100),
  PRIMARY KEY (id_villano)
);

CREATE TABLE pelicula (
  id_pelicula INT,
  titulo VARCHAR(100),
  fecha_estreno DATE,
  PRIMARY KEY (id_pelicula)
);

CREATE TABLE protagoniza (
  id_sup INT,
  id_villano INT,
  id_pelicula INT,
  PRIMARY KEY (id_sup, id_villano, id_pelicula),
  FOREIGN KEY (id_sup) REFERENCES superheroe (id_sup)
    ON DELETE CASCADE ON UPDATE CASCADE,
  FOREIGN KEY (id_villano) REFERENCES villano (id_villano)
    ON DELETE CASCADE ON UPDATE CASCADE,
  FOREIGN KEY (id_pelicula) REFERENCES pelicula (id_pelicula)
    ON DELETE CASCADE ON UPDATE CASCADE
);


